    const [paymentSchemas, setPaymentSchemas] = useState([]); 
    const [success, setSuccess] = useState(null);
    const [showModal, setShowModal] = useState(false);
    const [selectedApartment, setSelectedApartment] = useState(null);

    useEffect(() => {
