                        <div className="form-group">
                
                            <input
                                type="text"
                                className="form-control no-spinner"
                                id="discount"
                                placeholder="€"
                            />
                        </div>
                    </div>



                    
                    <div className="broker-container">
                        
                    </div>
                </div>

                

                <button type="submit" className="btn btn-outline-primary mt-3">
                    Create Sell
                </button>
            </form>
        </div>
    );
};

